function Prac(props) {
    return (
        <div>
            <h2>hello</h2>
            {props.data.map((item, i) => {
                return (
                    <h3 key={i}>{item}</h3>
                )
            })}
        </div>
    )
}
export default Prac




function getData() {

    // const promise = fetch('https://jsonplaceholder.typicode.com/users')
    // promise.then((res)=>{
    //     // console.log(res)
    //     return res.json()
    // }).then((data)=>{
    //     console.log(data)
    // })

    // console.log(promise)

    const feching = fetch('https://jsonplaceholder.typicode.com/users')
    feching.then((values) => {
        // console.log(values);
        return values.json()
    })
        .then((data) => {
            console.log(data);
        })
        
}
